class App extends Component {
  render() {
    return (
      <div className="App">
            <NavBar />
            {/* <Routes /> */}
        <Route exact path="/" component={App} />
        <Route  path="/login" component={Login} />
        <Route  path="/signup" component={Signup} />
      </div>
    );
  }
}

export default App;
